In Flutter, to hide an AppBar and BottomNavigationBar while scrolling, you can use the `ScrollController` and listen to the user's scroll events to determine when to show or hide these widgets. The `SliverAppBar` widget can be used for the AppBar, which comes with the capability to hide on scroll when the `floating` and `snap` properties are set to false, and `pinned` is set to false. For the BottomNavigationBar, you would have to implement the logic manually.

Here's a basic example of how you can achieve this:

```dart
import 'package:flutter\/material.dart';

void main() => runApp(MyApp());

class MyApp extends StatelessWidget {
  @override
  Widget build(BuildContext context) {
    return MaterialApp(
      home: Scaffold(
        body: MyHomePage(),
      ),
    );
  }
}

class MyHomePage extends StatefulWidget {
  @override
  _MyHomePageState createState() => _MyHomePageState();
}

class _MyHomePageState extends State<MyHomePage> {
  ScrollController _hideBottomNavController;
  bool _isBottomNavigationVisible = true;

  @override
  void initState() {
    super.initState();
    _hideBottomNavController = ScrollController();
    _hideBottomNavController.addListener(() {
      if (_hideBottomNavController.position.userScrollDirection ==
          ScrollDirection.reverse) {
        if (_isBottomNavigationVisible) {
          setState(() {
            _isBottomNavigationVisible = false;
          });
        }
      } else {
        if (_hideBottomNavController.position.userScrollDirection ==
            ScrollDirection.forward) {
          if (!_isBottomNavigationVisible) {
            setState(() {
              _isBottomNavigationVisible = true;
            });
          }
        }
      }
    });
  }

  @override
  void dispose() {
    _hideBottomNavController.dispose();
    super.dispose();
  }

  @override
  Widget build(BuildContext context) {
    return Scaffold(
      appBar: AppBar(
        title: Text('Hide AppBar and BottomNavigationBar'),
      ),
      body: CustomScrollView(
        controller: _hideBottomNavController,
        slivers: <Widget>[
          \/\/ Use SliverAppBar to allow the AppBar to hide when scrolled
          SliverAppBar(
            expandedHeight: 200.0,
            floating: false,
            pinned: false, \/\/ Set pinned to false to hide AppBar on scroll
            flexibleSpace: FlexibleSpaceBar(
              background: Image.network(
                'https:\/\/placekitten.com\/200\/300',
                fit: BoxFit.cover,
              ),
            ),
          ),
          SliverList(
            delegate: SliverChildBuilderDelegate(
              (context, index) => ListTile(title: Text('Item $index')),
              childCount: 30,
            ),
          ),
        ],
      ),
      bottomNavigationBar: _isBottomNavigationVisible
          ? BottomNavigationBar(
              items: const <BottomNavigationBarItem>[
                BottomNavigationBarItem(
                  icon: Icon(Icons.home),
                  label: 'Home',
                ),
                BottomNavigationBarItem(
                  icon: Icon(Icons.business),
                  label: 'Business',
                ),
              ],
            )
          : null,
    );
  }
}
```

In this example, we have a `CustomScrollView` with a `SliverAppBar` and a `SliverList`. The `SliverAppBar`'s `pinned` property is set to false, so it will hide when scrolling down. We're also using a `ScrollController` (`_hideBottomNavController`) to listen to scroll events and toggle the visibility of the `BottomNavigationBar` based on the scroll direction. When the user scrolls up (`ScrollDirection.forward`), the `BottomNavigationBar` appears, and when the user scrolls down (`ScrollDirection.reverse`), it disappears.

Make sure you dispose of the `ScrollController` in the `dispose` method to prevent memory leaks.

