  }
}
```

In this example, we have a `CustomScrollView` with a `SliverAppBar` and a `SliverList`. The `SliverAppBar`'s `pinned` property is set to false, so it will hide when scrolling down. We're also using a `ScrollController` (`_hideBottomNavController`) to listen to scroll events and toggle the visibility of the `BottomNavigationBar` based on the scroll direction. When the user scrolls up (`ScrollDirection.forward`), the `BottomNavigationBar` appears, and when the user scrolls down (`ScrollDirection.reverse`), it disappears.

Make sure you dispose of the `ScrollController` in the `dispose` method to prevent memory leaks.

