In Yacc (Yet Another Compiler Compiler), `$$` is a special symbol used in the grammar's action code to refer to the value of the non-terminal on the left-hand side of a production rule.

Yacc is used to generate a parser from a specification file containing grammar rules. The grammar rules define how tokens from the input stream are combined to form the constructs of the language. Each rule is generally composed of a left-hand side, which is a non-terminal symbol representing a language construct, and a right-hand side, which is a sequence of terminal and\/or non-terminal symbols that can be reduced to the non-terminal on the left-hand side.

Here's an example to illustrate:

```
expr: expr '+' term { $$ = $1 + $3; }
     | term         { $$ = $1; }
     ;

term: \/* ... *\/
     ;
```

In this simplified example, the `expr` rule has two productions. The first production says that an `expr` followed by a `'+'` followed by a `term` can be reduced to an `expr`. The action code `{ $$ = $1 + $3; }` expresses that the value of this new `expr` (`$$`) is the sum of the values of the first `expr` (`$1`) and the `term` (`$3`). The second production simply says that a `term` by itself is already an `expr`, and the action `{ $$ = $1; }` assigns the value of the `term` directly to the `expr`.

In summary, `$$` represents the result of a production, and it's typically used to construct the abstract syntax tree (AST) or to perform semantic actions during parsing. The `$1`, `$2`, `$3`, etc., are placeholders for the values of the symbols in the production, with each number corresponding to the position of the symbol on the right-hand side of the rule.

