In SAS, the `PROC PRINT` statement is used to print the contents of a dataset. The `VAR` statement within `PROC PRINT` specifies which variables (columns) you want to include in the output. If you don't use a `VAR` statement, SAS will print all variables in the dataset by default.

Here's a basic example:

```sas
PROC PRINT DATA=mydata;
   VAR name age salary;
RUN;
```

In this example, only the variables `name`, `age`, and `salary` from the dataset `mydata` will be printed. If the dataset contains other variables, they will not be included in the output because they are not listed in the `VAR` statement. This allows you to customize the output of `PROC PRINT` to include only the information you're interested in.
